import React from 'react';
import Board from "./Components/Board"

class App extends React.Component {
  constructor () {
    super()
    this.turn = 'w'
    this.state = {
      status: ""
    }
    
  }
  render () {
    return(
      <div className="game">
        <h1 className="status"></h1>
        <Board />
      </div>
     
    )
  }
}

export default App;
